import * as React from "react";
import { useState } from "react";
import { Button } from "./Button";
import Send from "../assets/icons/send.svg";
import { CityDropDown } from "./CityDropdown";

export interface Props {}

export function SearchBar(props: Props) {
  const [isOpen, setIsOpen] = useState<string | null>("hidden");
  const clickHandler = () => {
    isOpen !== "block" ? setIsOpen("block") : setIsOpen("hidden");
    return "hi";
  };
  return (
    <section className=" dark:bg-gray-900 flex items-center mt-[540px] z-20 absolute w-full ">
      <div className=" max-w-screen-xl px-4 mx-auto lg:px-12  w-full ">
        {/* <!-- Start coding here --> */}
        <div className="relative bg-[#fff] shadow-md dark:bg-gray-800 sm:rounded-lg rounded-xl flex md:flex-col gap-2">
          <div className="grid grid-cols-5 gap-2 divide-x divide-[#D7E2EE] pt-0 mt-0 h-8">
            <button className="text-[10px] pt-1 text-darkGreen font-semibold md:text-[12px]">
              شـراء عقارات
            </button>
            <button className=" text-[10px] pl-1 pt-1 text-darkGreen font-semibold md:text-[12px]">
              بـيع عقارات
            </button>
          </div>
          <div className="px-4 pt-1 flex gap-1 flex-col justify-center items-center w-full md:flex-row ">
            <div className="three w-full lg:w-1/5">
              <CityDropDown
                name="الـمواصفات"
                item1="1+0"
                item2="1+1"
                item3="2+1"
                item4="3+1"
              />
            </div>
            <div className="one lg:w-2/5 w-full">
              <CityDropDown
                name="الـمواصفات"
                item1="1+0"
                item2="1+1"
                item3="2+1"
                item4="3+1"
              />
            </div>
            <div className="two lg:w-2/5 w-full">
              <CityDropDown
                name="الـمواصفات"
                item1="1+0"
                item2="1+1"
                item3="2+1"
                item4="3+1"
              />
            </div>
          </div>
          <div className="py-1 px-4 flex justify-center md:justify-start">
            <Button
              bgBtn={"bg-mint"}
              textSize={"[10px] lg:text-[14px]"}
              color={"text-darkGreen"}
              fontWeight={"normal"}
              width={"119"}
              m={" mb-[4px]"}
              p={"md:px-[8px] "}
              children={" أبحث"}
              onClick={clickHandler}
              icon={Send}
              other={"bg-darkGreen"}
            />
          </div>
        </div>
      </div>
    </section>
  );
}
